import React,{useState,useEffect} from 'react'
import axios from 'axios'
import SwiperCore, { Navigation, Pagination, Scrollbar} from 'swiper';

import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/swiper-bundle.css';
import {Grid,Image,Card,Button, Icon} from 'semantic-ui-react'
import { Link } from 'react-router-dom';


const SwiperSlider = () => {

  const [multipleFiles, setMultipleFiles] = useState([]);
  const getMultipleFiles = async () => {
    try{
        const {data} = await axios.get('http://localhost:5000/api/getMultipleFiles');
        return data;
    }catch(error){
        throw error;
    }
}
  const getMultipleFilesList = async () => {
    try {
        const fileslist = await getMultipleFiles();
        setMultipleFiles(fileslist);
    } catch (error) {
      console.log(error);
    }
  }
    useEffect(() => {
      getMultipleFilesList()
      // eslint-disable-next-line react-hooks/exhaustive-deps
    }, []);
    return (
      <div>
        <Grid columns={2}>
            {multipleFiles.map((element, index) =>
                <div key={element._id}>
                 <Card>
                  <Card.Content>
                  <Button basic color='green'>
                    <Icon name='video'/>
                  </Button>
                    <Grid>
                        <Grid.Column>
                        <Swiper
                          slidesPerView={1}
                          navigation
                          pagination={{ clickable: true }}
                          scrollbar={{ draggable: true }}
                        >
                          {element.files.map((url, index) =>
                            <div className="col-6">
                                <SwiperSlide key={index}>
                                <Link to={`/houseDetails/${element._id}`}>
                                <Image src={url} wrapped alt="img"/>
                                </Link>
                                </SwiperSlide>
                              </div>
                          )}
                       </Swiper>
                       </Grid.Column>
                    </Grid>
                  </Card.Content>
                      <Card.Content extra>
                        <Card.Description>
                        {element.housename}
                          , {element.sefer}
                        </Card.Description>
                      </Card.Content>
                </Card>
                </div>
              )}

            </Grid>
      </div>
    )
}

export default SwiperSlider
